import React, { Component } from 'react';

import Admin from './admin';
import List from './list';

class App extends Component {
    render(){
        let { user }  = this.props.match.params;

        return (
        <div style={{background: 'black'}}>
            <Admin userX={user}/>
            <List />
        </div>
        );
    }
}

export default App;
